import React from 'react';
import coverImage from '../../assets/covercover/leone-venter-VieM9BdZKFo-unsplash.jpg'

function Header(props) {
    return (
        <header className="flex-row space-between px-1">
            <h1>Joel Perez</h1>
            <img src="wooden background"></img>
            {props.children}
        </header>
    );
}

export default Header;
